import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function DeveloperDetails({ match }) {
    const [developer, setDeveloper] = useState(null);

    useEffect(() => {
        axios.get(`http://localhost:8000/api/devs/${match.params.id}`)
            .then(response => {
                setDeveloper(response.data);
            })
            .catch(error => {
                console.error('Erro ao buscar desenvolvedor:', error);
            });
    }, [match.params.id]);

    return (
        <div>
            {developer ? (
                <div>
                    <h1>Detalhes do Desenvolvedor: {developer.name}</h1>
                    <p>Nickname: {developer.nickname}</p>
                    <p>Data de Nascimento: {developer.birth_date}</p>
                    <p>Pilha Tecnol√≥gica: {developer.stack ? developer.stack.join(', ') : 'Nenhuma'}</p>
                </div>
            ) : (
                <p>Carregando detalhes do desenvolvedor...</p>
            )}
        </div>
    );
        }
